import React from 'react';

const FunctionParenthesisAndParameters = () => {
    const square = a => a * a;
    const plusOne = a => a + 1;
    const twoSquared = square(2);
    const threePlusOne = plusOne(3);
}

export default FunctionParenthesisAndParameters
